import Slider from "../../components/Carousel/carousel";
import Presta from "../Presta/presta.tsx";
import Aboutme from "../Aboutme/aboutme.tsx";
import Instacontact from "../Instacontact/instacontact.tsx";
import Footer from "../../components/Footer/footer.tsx";
import Cookies from "js-cookie";

function Home() {
  const [isCookieSet, setCookie] = useState(Cookies.get("cookieConsent"));

  // Function to handle accepting cookies
  const handleAcceptCookies = () => {
    Cookies.set("cookieConsent", true);
    setCookie(true);
  };

  // Function to handle rejecting cookies
  const handleRejectCookies = () => {
    Cookies.remove("cookieConsent");
    setCookie(false);
  };

  const language = getLanguageCookie();
  return (
    <div>

      <Slider />
      <Presta />
      <Aboutme />
      <Instacontact />
      <Footer />
      <Cookiebar/>
    </div>
  );
}

export default Home;
